import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

//const example
const currDate = () => {
    const date = new Date();
    return date.toDateString();
}

const starter = <h1>Hello Tarcisius<br/>Current Date: {currDate()}</h1>;

//making classes exercises
class Car {
    constructor(name){
        this.brand = name;
    }

    show(){
        return 'I have a ' + this.brand;
    }    
}

class CarType extends Car{
    constructor(name, spec){
        super(name);
        this.type = spec;
    }

    tell(){
        return this.show() + ', the specific type is ' + this.type;
    }
}
const myCar = new CarType('BMW', 'M4');
ReactDOM.render(myCar.tell(), document.getElementById('root'));

